import{_ as a,c as t,o as e,a as i}from"./app.44eaed71.js";const m=`{"title":"What is Voyager","description":"","frontmatter":{},"headers":[{"level":2,"title":"What it is","slug":"what-it-is"},{"level":2,"title":"What it isn't","slug":"what-it-isn-t"}],"relativePath":"getting-started/what-is-voyager.md","lastUpdated":1639668501558}`,o={},r=i('<h1 id="what-is-voyager" tabindex="-1">What is Voyager <a class="header-anchor" href="#what-is-voyager" aria-hidden="true">#</a></h1><p>Before installing Voyager it is very important to take a quick moment to learn <em>what it is</em> &amp; <em>what it isn&#39;t</em>.</p><h2 id="what-it-is" tabindex="-1">What it is <a class="header-anchor" href="#what-it-is" aria-hidden="true">#</a></h2><ul><li>An admin interface for your Laravel app</li><li>An easy way to add/edit/delete data for your app</li><li>A media manager for your files</li><li>CRUD/BREAD generator</li></ul><p>Voyager is simply an admin for your Laravel app. Whatever you want your app to do on the front-end is completely up to you. You are in control of your application and you can use Voyager to make your life easier by adding data, editing users, creating menus, and many other administrative tasks.</p><h2 id="what-it-isn-t" tabindex="-1">What it isn&#39;t <a class="header-anchor" href="#what-it-isn-t" aria-hidden="true">#</a></h2><ul><li>A content management system (CMS)</li><li>A blogging platform</li><li>Wordpress (Bleh! \u{1F61C})</li></ul><p>Voyager is not a CMS or a blogging platform. It can be used to create a CMS or a blogging platform, but out of the box it is neither of those. As stated in the previous section you have full control on what your application will do and how it will function.</p><p>With Laravel &amp; Voyager you can create any kind of application your heart desires. Laravel &amp; Voyager are simply tools to make it easier to build.</p>',9),n=[r];function s(l,d,h,p,c,u){return e(),t("div",null,n)}var g=a(o,[["render",s]]);export{m as __pageData,g as default};
